import React from 'react'
import { Outlet } from 'react-router-dom'
import { Layout } from 'antd';

const { Header, Footer, Sider, Content } = Layout;

export default function App() {
  return (
    <Layout>
      <Header>Header</Header>
      <Layout>
        <Sider>Sider</Sider>
        <Content>      
          <Outlet/>
        </Content>
      </Layout>
      <Footer>Footer</Footer>
    </Layout>

  )
}
